This application is developed for the corresponding APP end of our official website ( shop.luvmehair.com ). Our product is a vertical segment of wigs, and our customers are mainly women who needs wigs/hair. The brand of our website is LUVME HAIR. This brand has a high reputation in the European and American markets. It has won praises from a large number of customers with high-quality products and services, and has strong customer stickiness and brand power. Therefore, we developed the APP that has a good customer experience and is easy to use, which will greatly improve the experience of our customers.

1. Support customers to browse products and information;
2. Support customers to add products to the shopping cart and place orders;
3. Support customer login and query account and order situation; 
4. Support customers to view official promotional information and so on;
